import Chart from "../Chart/Chart";

const ExpenseChart = (props) => {
  const expenseDataPoints = [
    { label: "Jan", Value: 0 },
    { label: "Feb", Value: 0 },
    { label: "Mar", Value: 0 },
    { label: "Apr", Value: 0 },
    { label: "May", Value: 0 },
    { label: "Jun", Value: 0 },
    { label: "Jul", Value: 0 },
    { label: "Aug", Value: 0 },
    { label: "Sep", Value: 0 },
    { label: "Aug", Value: 0 },
    { label: "Nov", Value: 0 },
    { label: "Dec", Value: 0 },
  ];

  for (const expense of props.expenses) {
    const monthIndex = expense.date.getMonth();
    datapoints[monthIndex] += expense.amount;
  }

  return <Chart datapoints = {expenseDataPoints}/>
};

export default ExpenseChart;
